import React from "react";
import {
  Html,
  ContactShadows,
  PresentationControls,
  Float,
  Environment,
  useGLTF,
} from "@react-three/drei";
import "./App.css";

export default function App() {
  const laptop = useGLTF("./laptoptwo.gltf");

  return (
    <>
      <Environment preset="city" />

      <PresentationControls
        global
        rotation={[0.2, 0, 0]}
        polar={[-0.4, 0.2]}
        azimuth={[-1, 0.75]}
        config={{ mass: 2, tension: 400 }}
        snap={{ mass: 4, tension: 400 }}
      >
        <Float rotationIntensity={0.4}>
          <primitive
            object={laptop.scene}
            position-y={-1}
            position-x={-1}
            position-z={-1.5}
            rotation-z={Math.PI * 1}
            rotation-x={-Math.PI * 0.5}
          />

          <Html
            transform
            position={[0, 0.35, -1.1]}
            occlude
            distanceFactor={1.3}
            wrapperClass="htmlScreen"
            rotation-x={-0.256}
          >
            <iframe scrolling="no" src="https://danish.dev"></iframe>
          </Html>
        </Float>
      </PresentationControls>

      <ContactShadows position-y={-1.4} opacity={0.4} scale={5} blur={2.4} />
    </>
  );
}
